import React from 'react';
import '../styles/App.css';
import Task from './Task';

const appStyle = {
    margin: "20px",
}

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            tasks: [],
        }
    }

    render() {
        return (
            <div className="App" style={appStyle}>
                <Task number="1"/>
                <Task />
                <Task />
            </div>
        );
    }
}

export default App;
